import { useState,useEffect } from "react";
import { Navigate, useLocation } from "react-router";
import { callUrl, getProfileDetailService } from '../services/callApi';
import { useNavigate } from "react-router";
import './Profile.css'

const Profile = () => {
    const [urls, setUrls] = useState([]);
    const [errorMessage, setErrorMessage] = useState("");
    const [usersData,setUsersData]=useState([])
    const navigate = useNavigate()
    const location = useLocation()

    const name= location.state.loginName
    console.log("jjjj",location)

    useEffect(()=>{
        try{
            let profileResponse= getProfileDetailService(name)
            setUsersData(profileResponse)
        }catch(error){
console.log("cant fetch data in user profil:",error)
        }



    },[])


    const backButton = ()=>{
        navigate(-1)
    }

    return (
        <>

            <button className='backToSearch' onClick={backButton}>Back to Search</button>
            {usersData.map((items,index)=>{
                return
            })}

        </>
    );
};

export default Profile;
